window.bookSummaryJSON = "<p>Classes continue at Haylon academy. Ken has identified who's behind the attacks on his Fieore and is determined to remove that particular problem, yet Haylon rules prevents him from taking it into his own hands.</p> <p>As they dive deeper into the dungeon, Crimson prepares him and the rest of the first years on how to camp in the dungeon. When their camping exercise is interrupted, Ken's done, and this time, he means business.</p> <p>Ken going all out with his abilities tell him one thing—Ken was never trained as an adventurer. Ken was trained as an assassin....</p>"; 
